import React from 'react';
import pdf from './DIODES.pdf';
 import './Pdf_reader.css';

const Pdf_reader = () => (
	<div >
		<iframe className='pdf' src={`${pdf}#zoom=100`}/>
	</div>
);

export default Pdf_reader;
